ananowy z soku zageszczonego (0,5%), stabilizatory (mqczka chleba éwietojafiskiego, guma guar, karagen, alginian sodu, pektyny), emulgator (mono- i diglicenydy kwaséw tluszczowych), banan (0,1%), aromaty, regulator kwasowoéci (kwas cywnowy), bawnik (karoteny). Moie zawieraé: jaja, soj?, orzechy. Najlepiej spoiyé przed kohcem: patrz bok opakowania. Przechowywaé w temperaturze nie wy2szej nii -1800', 'https://static.openfoodfacts.org/images/products/871/410/096/5207/front_fr.4.400.jpg', '5.6', '5.1', '26', '18', '0', '1.8', '0.14', '0.0551181102362205', '', '0');

